import React from "react";
import CardPost from "../../components/CardPost";
import logo from "../../assets/profile.jpg";
import * as S from "./styled";
import { FaWindowClose } from "react-icons/fa";

const Post = () => {
  return (
    <S.Wrapper>
      <S.ModalContent>
        <img src={logo} alt="" />
        <S.CloseModal>
          <FaWindowClose />
        </S.CloseModal>
      </S.ModalContent>
    </S.Wrapper>
  );
};

export default Post;
